import React from 'react';
import { NavLink } from 'react-router-dom';


const navObj = {
    title: 'PEDRO BERGAMO',
    logo: 'images/logo.png',
    navStyle: {
        fontSize: '1em',
        marginTop: '16px',
        float: 'right'
    },
    brandStyle: {
        fontSize: '1.4em'
    },
    linkStyle: {
      marginRight: '16px'
    }
};
          const Navbar = () => {
            return (
              <nav>
                <ul>
                  <li>
                    <NavLink to="/">Test</NavLink>
                  </li>
                  <li>
                    <NavLink to="/contact">Test</NavLink>
                  </li>
                </ul>
              </nav>
            );
          };

          Navbar.propTypes = {};

          export default Navbar;
